body:
Mình cần bán CG 2022 màu đỏ, biển SG chính chủ (1 đời chủ) odo 14k, xe đag độ máy lớn 174cc, đồ zin, máy zin 125 đủ (về zin 1p30s), cặp đèn trợ sáng kenzo X100v2, pô độ classic như hình, baga inox, thanh giằng và gù chống rung inox, bánh sau lên 3.0. Độ đá chống tắt máy, ốp phuột trước, bóng xi nhan + lái, đèn trước led sáng đẹp bền và tiết kiệm điện :)
Giá mong muốn 33 trđ (bao công chứng); 
a Tuấn *** (43 tuổi), xem xe ở Tân Bình/Củ Chi, tks ace!

Dư dùng nên cần ra đi em future fi 207;(máy móc nguyên zin)
Xem xe ở Long Xuyên An Giang;
Gía ra đi: 31tr;
Liên hệ: *** (Chính chủ);
